function Sidebar() {
  return (
    <aside className="sidebar">
      <h3>Block Library</h3>

      <button className="export-btn">Export Project</button>

      <div className="block">Hero Section</div>
      <div className="block">Bio Section</div>
      <div className="block">Gallery</div>
      <div className="block">Publications</div>
      <div className="block">Contact Section</div>
      <div className="block">Footer</div>
    </aside>
  );
}

export default Sidebar;
